"use strict";

var _rendererId = require("./rendererId");

var _rendererConnect = require("./rendererConnect");

window.addEventListener('error', function () {
  _rendererConnect.rendererConnect.postMessage({
    type: 'rendererError',
    payload: {
      rendererId: _rendererId.rendererId
    }
  });
});
